import React from 'react'
import FetchData1 from './FetchData1';



  const FetchData3 = ({todos}) => (
    <div>
      <h6>todos</h6>
      <ul>
      {todos.map(({todo, index}) => (
        <li key={index}>{todo}</li>
      ))}
      </ul>
    </div>
  )
  
  FetchData3.propTypes = {
    todos: React.PropTypes.array,
  };
  
  export default FetchData3;
